import React from 'react';
import Card from './Card';



const CardList = (robots) => {
    const cardComponent = robots.map((i) => {
        return <Card key={i} id={i.id} name={i.name} email={i.email}/>
    })
    return (
    <div>
        {cardComponent}
    </div>
    );
}

export default CardList;
